import React from 'react';
import Booklist from "./components/Booklist";
import { BrowserRouter, Route, Link } from 'react-router-dom';
import axios from 'axios';

const App = () => {
  const languages = ['React', 'Anguler', 'Vue'];
  const getDataFromAPI = keyword => {
    const requestsUrl = 'https://www.googleapis.com/books/v1/volumes?q=intitle';
    const result = axios.get(`${requestsUrl}${keyword}`);
    return result;
  }
  return (
    <BrowserRouter>
      <div>
        <ul>
          <li>
            <Link to="/">React</Link>
          </li>
          <li>
            <Link to="/vue">Vue</Link>
          </li>
          <li>
            <Link to="/angular">angular</Link>
          </li>
        </ul>
        <h1>react app</h1>
        <Route
          exact
          path="/"
          render={(props) => (
            <Booklist
              languages={languages[0]}
              getData={(keyword) => getDataFromAPI(keyword)}
            />
          )}
        />
        <Route
          path="/vue"
          render={(props) => (
            <Booklist
              languages={languages[2]}
              getData={(keyword) => getDataFromAPI(keyword)}
            />
          )}
        />
        <Route
          path="/angular"
          render={(props) => (
            <Booklist
              languages={languages[1]}
              getData={(keyword) => getDataFromAPI(keyword)}
            />
          )}
        />
      </div>
    </BrowserRouter>
  );
}

export default App;
